// src/components/Repository.js
import React from 'react';

function Repository({ repository }) {
  return (
    <div>
        <ul>

            <p>{repository.description}</p>
            <p>Topics: {repository.topics && repository.topics.join(', ')}</p>
        </ul>
    </div>
  );
}

export default Repository;
